import React, { Component } from "react"; //npx create-react-app amq, npm run build, cd amq, npm start
// import React {Component} from "react";
import ReactDOM from "react-dom"; //npm install react-dom --save
import { BrowserRouter, Routes, Route } from "react-router-dom"; //npm install react-router-dom --save
import Nav from "./pages/Nav";
import HomePage from "./pages/Home";
import AboutPage from "./pages/About";
import ContactPage from "./pages/Contact";
import NoPage from "./pages/Nopage";
import reportWebVitals from "./reportWebVitals";

// export default function App()
class App extends Component{
  render(){
  return (
    <BrowserRouter>
      <Routes>
          <Route path="/" element={<Nav />}>
          <Route index element={<HomePage />} />
          <Route path="About" element={<AboutPage />} />
          <Route path="Contact" element={<ContactPage />} />
          <Route path="*" element={<NoPage />} />
          </Route>          
      </Routes>
    </BrowserRouter>
  );
  }
}
ReactDOM.render(<App />, document.getElementById("root"));
reportWebVitals();








